import React from 'react'
import './navbar.css';

const Navbar = () => {
  return (
    <div className='navbar'>
    <nav class="navbar navbar-expand-sm py-0">
     <a class="navbar-brand px-0" href="/">
        <img src="/" class="img-fluid logo ml-md-3" />
     </a>
     <ul class="nav ml-auto">
        <li class="nav-item ">
          <button class="btn py-0 px-3 sidebar_menu_btn ml-auto" aria-label="sidebar_menu"><i class="fa fa-bars" aria-hidden="true"></i></button>
        </li>
    </ul>
    
</nav>
    </div>
  )
}

export default Navbar;
